import React, { useState, useEffect } from 'react';

var d = new Date();

function Wave(){
    const[swell,setSwell] = useState(null);
    const[swell2,setSwell2] = useState(null);


    useEffect(async () =>{
        const response = await fetch(`https://api.stormglass.io/v2/weather/point?lat=21.275767&lng=-157.827374&params=swellHeight,swellDirection,swellPeriod&key=947985f0-4e3b-11eb-a422-0242ac130002-947986ea-4e3b-11eb-a422-0242ac130002`);
        const data = await response.json();
        const [item] = data.hours;
        setSwell(item);

        const response2 = await fetch(`https://api.stormglass.io/v2/weather/point?lat=21.302995&lng=-158.045315&params=swellHeight,swellDirection,swellPeriod&key=947985f0-4e3b-11eb-a422-0242ac130002-947986ea-4e3b-11eb-a422-0242ac130002`);
        const data2 = await response2.json();
        const [item2] = data2.hours;
        setSwell2(item2);

        const response3 = await fetch(`https://api.stormglass.io/v2/weather/point?lat=21.660880&lng=-158.057782&params=swellHeight,swellDirection,swellPeriod&key=947985f0-4e3b-11eb-a422-0242ac130002-947986ea-4e3b-11eb-a422-0242ac130002`);
    },[]);

    return (
        <div className="Wave">
            <main>
                <div className="wave-box-left">
                    Pipeline

                </div>

                <div className="wave-box-center">
                    Queens/Canoes

                {swell &&<div className="info">
                        {swell.swellHeight.noaa}ft at {swell.swellPeriod.noaa}s

                </div>}

                </div>

                <div className="wave-box-right">
                    White Plains
                    {swell2 &&<div className="info">
                        {swell2.swellHeight.noaa}ft at {swell2.swellPeriod.noaa}s

                </div>}
                </div>
            </main>
        </div>
    )
}
export default Wave;
